import React from "react";
import { BrowserRouter as Router, Route, Link } from "react-router-dom";

class Home extends Component {
    render(){
        return (<h1>Hi</h1>);
    }
}

render(
    <Router>

        <Route path="/" component={Home}/>
    </Router>,
    document.getElementById('container')
);
